# Check for recent RustDesk errors
Write-Host "=== Checking Recent RustDesk Errors ===" -ForegroundColor Cyan
Write-Host ""

# Check System log for RustDesk service errors
Write-Host "Recent RustDesk service events (last 10 minutes):" -ForegroundColor Yellow
$events = Get-EventLog -LogName System -Source "Service Control Manager" -After (Get-Date).AddMinutes(-10) | Where-Object { $_.Message -like "*RustDesk*" } | Select-Object -First 10
if ($events) {
    $events | ForEach-Object {
        Write-Host ""
        Write-Host "Time: $($_.TimeGenerated)" -ForegroundColor Cyan
        Write-Host "EventID: $($_.EventID)" -ForegroundColor $(if ($_.EventID -eq 7034) { 'Red' } else { 'Yellow' })
        Write-Host "Type: $($_.EntryType)" -ForegroundColor $(if ($_.EntryType -eq 'Error') { 'Red' } else { 'Yellow' })
        $msgLines = $_.Message -split "`n" | Select-Object -First 5
        $msgLines | ForEach-Object { Write-Host "  $_" }
    }
} else {
    Write-Host "No recent RustDesk events found" -ForegroundColor Green
}

Write-Host ""
Write-Host "Checking Application log for RustDesk errors:" -ForegroundColor Yellow
try {
    $appEvents = Get-EventLog -LogName Application -After (Get-Date).AddMinutes(-10) | Where-Object { $_.Source -like "*RustDesk*" -or $_.Message -like "*RustDesk*" } | Select-Object -First 10
    if ($appEvents) {
        $appEvents | ForEach-Object {
            Write-Host ""
            Write-Host "Time: $($_.TimeGenerated)" -ForegroundColor Cyan
            Write-Host "Source: $($_.Source)"
            Write-Host "EventID: $($_.EventID)"
            Write-Host "Level: $($_.EntryType)"
            $msgLines = $_.Message -split "`n" | Select-Object -First 3
            $msgLines | ForEach-Object { Write-Host "  $_" }
        }
    } else {
        Write-Host "No RustDesk events in Application log" -ForegroundColor Green
    }
} catch {
    Write-Host "Could not check Application log: $_" -ForegroundColor Yellow
}

Write-Host ""
Write-Host "Checking if service process exists and is stable:" -ForegroundColor Yellow
$processes = Get-Process -Name rustdesk -ErrorAction SilentlyContinue
if ($processes) {
    Write-Host "Found $($processes.Count) RustDesk process(es):" -ForegroundColor Green
    $processes | ForEach-Object {
        Write-Host "  PID: $($_.Id), CPU: $($_.CPU), Memory: $([math]::Round($_.WorkingSet64 / 1MB, 2)) MB"
    }
} else {
    Write-Host "No RustDesk processes found - service is not running" -ForegroundColor Red
}

