# RustDesk Fix Script

Write-Host "=== Checking Windows Defender Exclusions ===" -ForegroundColor Cyan
try {
    $prefs = Get-MpPreference -ErrorAction Stop
    Write-Host "Current exclusion paths:"
    if ($prefs.ExclusionPath) {
        $prefs.ExclusionPath | ForEach-Object { Write-Host "  - $_" }
    } else {
        Write-Host "  (none)"
    }
    Write-Host "Current exclusion processes:"
    if ($prefs.ExclusionProcess) {
        $prefs.ExclusionProcess | ForEach-Object { Write-Host "  - $_" }
    } else {
        Write-Host "  (none)"
    }

    $rustdeskPath = "C:\Program Files\RustDesk"
    $rustdeskExe = "RustDesk.exe"

    $needsPath = $true
    $needsProcess = $true

    if ($prefs.ExclusionPath -contains $rustdeskPath) {
        Write-Host "`nPath exclusion already exists: $rustdeskPath" -ForegroundColor Green
        $needsPath = $false
    }

    if ($prefs.ExclusionProcess -contains $rustdeskExe) {
        Write-Host "Process exclusion already exists: $rustdeskExe" -ForegroundColor Green
        $needsProcess = $false
    }

    if ($needsPath -or $needsProcess) {
        Write-Host "`nAdding exclusions..." -ForegroundColor Yellow
        if ($needsPath) {
            try {
                Add-MpPreference -ExclusionPath $rustdeskPath -ErrorAction Stop
                Write-Host "Added path exclusion: $rustdeskPath" -ForegroundColor Green
            } catch {
                Write-Host "Failed to add path exclusion: $_" -ForegroundColor Red
                Write-Host "This may require administrator privileges" -ForegroundColor Yellow
            }
        }
        if ($needsProcess) {
            try {
                Add-MpPreference -ExclusionProcess $rustdeskExe -ErrorAction Stop
                Write-Host "Added process exclusion: $rustdeskExe" -ForegroundColor Green
            } catch {
                Write-Host "Failed to add process exclusion: $_" -ForegroundColor Red
                Write-Host "This may require administrator privileges" -ForegroundColor Yellow
            }
        }
    } else {
        Write-Host "`nAll exclusions already in place" -ForegroundColor Green
    }
} catch {
    Write-Host "Cannot access Windows Defender preferences: $_" -ForegroundColor Red
    Write-Host "This may require administrator privileges" -ForegroundColor Yellow
}

Write-Host "`n=== Checking Runtime Dependencies ===" -ForegroundColor Cyan

# Check Visual C++ Redistributables
Write-Host "Visual C++ Redistributables:"
$vcRedists = Get-ItemProperty "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Uninstall\*" -ErrorAction SilentlyContinue | Where-Object { $_.DisplayName -like "*Visual C++*" }
if ($vcRedists) {
    $vcRedists | Select-Object DisplayName, DisplayVersion | Format-Table -AutoSize
} else {
    Write-Host "  No Visual C++ Redistributables found in registry"
}

# Check .NET Framework
Write-Host "`n.NET Framework versions:"
$netVersions = Get-ItemProperty "HKLM:\SOFTWARE\Microsoft\NET Framework Setup\NDP\v*\*\*" -ErrorAction SilentlyContinue | Select-Object Version, Release -Unique
if ($netVersions) {
    $netVersions | Format-Table -AutoSize
} else {
    Write-Host "  No .NET Framework versions found in registry"
}

Write-Host "`n=== Checking Service Configuration ===" -ForegroundColor Cyan
$service = Get-Service RustDesk -ErrorAction SilentlyContinue
if ($service) {
    Write-Host "Service Status: $($service.Status)"
    Write-Host "Start Type: $($service.StartType)"

    $svcConfig = sc.exe qc RustDesk 2>&1
    Write-Host "`nService Configuration:"
    $svcConfig

    Write-Host "`nService Dependencies:"
    sc.exe enumdepend RustDesk 0 2>&1
} else {
    Write-Host "RustDesk service not found"
}

Write-Host "`n=== Checking Port Conflicts ===" -ForegroundColor Cyan
$ports = @(21115, 21116, 21117, 21118, 21119)
foreach ($port in $ports) {
    $connection = Get-NetTCPConnection -LocalPort $port -ErrorAction SilentlyContinue
    if ($connection) {
        Write-Host "Port $port is in use by PID: $($connection.OwningProcess)"
    } else {
        Write-Host "Port $port is available"
    }
}

