# RustDesk Diagnostics Script

Write-Host "=== Checking RustDesk Executable ===" -ForegroundColor Cyan
$exe = "C:\Program Files\RustDesk\RustDesk.exe"
if (Test-Path $exe) {
    $fileInfo = Get-Item $exe
    Write-Host "File exists: $($fileInfo.FullName)"
    Write-Host "Version: $($fileInfo.VersionInfo.FileVersion)"
    Write-Host "Last Write: $($fileInfo.LastWriteTime)"
    Write-Host "Size: $($fileInfo.Length) bytes"
    $hash = Get-FileHash $exe -Algorithm SHA256
    Write-Host "SHA256: $($hash.Hash)"
} else {
    Write-Host "ERROR: RustDesk.exe not found!" -ForegroundColor Red
}

Write-Host "`n=== Checking Configuration Files ===" -ForegroundColor Cyan
$configPath = "$env:APPDATA\RustDesk\config"
if (Test-Path $configPath) {
    Get-ChildItem $configPath -Recurse -File | ForEach-Object {
        Write-Host "`n--- $($_.FullName) ---" -ForegroundColor Yellow
        Get-Content $_.FullName | Select-Object -First 20
    }
} else {
    Write-Host "Config directory not found: $configPath"
}

Write-Host "`n=== Checking Recent RustDesk Service Events ===" -ForegroundColor Cyan
$events = Get-EventLog -LogName System -Source "Service Control Manager" -After (Get-Date).AddDays(-2) | Where-Object { $_.Message -like "*RustDesk*" } | Select-Object -First 5
if ($events) {
    $events | ForEach-Object {
        Write-Host "Time: $($_.TimeGenerated), EventID: $($_.EventID), Type: $($_.EntryType)"
        Write-Host "Message: $($_.Message.Substring(0, [Math]::Min(200, $_.Message.Length)))"
        Write-Host ""
    }
} else {
    Write-Host "No recent RustDesk events found"
}

