# Add RustDesk to Windows Defender Exclusions
# This script must be run as Administrator

Write-Host "=== Adding RustDesk to Windows Defender Exclusions ===" -ForegroundColor Cyan

# Check for administrator privileges
$isAdmin = ([Security.Principal.WindowsPrincipal] [Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole([Security.Principal.WindowsBuiltInRole]::Administrator)
if (-not $isAdmin) {
    Write-Host "ERROR: This script must be run as Administrator!" -ForegroundColor Red
    Write-Host "Right-click PowerShell and select 'Run as Administrator', then run this script" -ForegroundColor Yellow
    exit 1
}

Write-Host "Administrator privileges confirmed" -ForegroundColor Green
Write-Host ""

# Check current exclusions
Write-Host "Current Windows Defender Exclusions:" -ForegroundColor Cyan
try {
    $prefs = Get-MpPreference -ErrorAction Stop
    Write-Host "`nExclusion Paths:" -ForegroundColor Yellow
    if ($prefs.ExclusionPath) {
        $prefs.ExclusionPath | ForEach-Object { Write-Host "  - $_" }
    } else {
        Write-Host "  (none)"
    }
    Write-Host "`nExclusion Processes:" -ForegroundColor Yellow
    if ($prefs.ExclusionProcess) {
        $prefs.ExclusionProcess | ForEach-Object { Write-Host "  - $_" }
    } else {
        Write-Host "  (none)"
    }
} catch {
    Write-Host "Could not retrieve current exclusions: $_" -ForegroundColor Red
}

Write-Host "`n=== Adding RustDesk Exclusions ===" -ForegroundColor Cyan

$rustdeskPath = "C:\Program Files\RustDesk"
$rustdeskExe = "RustDesk.exe"

# Add path exclusion
try {
    $currentPaths = (Get-MpPreference).ExclusionPath
    if ($currentPaths -notcontains $rustdeskPath) {
        Add-MpPreference -ExclusionPath $rustdeskPath -ErrorAction Stop
        Write-Host "Added path exclusion: $rustdeskPath" -ForegroundColor Green
    } else {
        Write-Host "Path exclusion already exists: $rustdeskPath" -ForegroundColor Yellow
    }
} catch {
    Write-Host "Failed to add path exclusion: $_" -ForegroundColor Red
}

# Add process exclusion
try {
    $currentProcesses = (Get-MpPreference).ExclusionProcess
    if ($currentProcesses -notcontains $rustdeskExe) {
        Add-MpPreference -ExclusionProcess $rustdeskExe -ErrorAction Stop
        Write-Host "Added process exclusion: $rustdeskExe" -ForegroundColor Green
    } else {
        Write-Host "Process exclusion already exists: $rustdeskExe" -ForegroundColor Yellow
    }
} catch {
    Write-Host "Failed to add process exclusion: $_" -ForegroundColor Red
}

Write-Host "`n=== Verification ===" -ForegroundColor Cyan
try {
    $prefs = Get-MpPreference -ErrorAction Stop
    $pathExists = $prefs.ExclusionPath -contains $rustdeskPath
    $processExists = $prefs.ExclusionProcess -contains $rustdeskExe

    if ($pathExists -and $processExists) {
        Write-Host "SUCCESS: Both exclusions are now active" -ForegroundColor Green
        Write-Host "Path exclusion: $pathExists" -ForegroundColor Green
        Write-Host "Process exclusion: $processExists" -ForegroundColor Green
        Write-Host "`nNext step: Restart the RustDesk service and test if it works" -ForegroundColor Cyan
    } else {
        Write-Host "WARNING: Some exclusions may not have been added" -ForegroundColor Yellow
        Write-Host "Path exclusion: $pathExists" -ForegroundColor $(if ($pathExists) { 'Green' } else { 'Red' })
        Write-Host "Process exclusion: $processExists" -ForegroundColor $(if ($processExists) { 'Green' } else { 'Red' })
    }
} catch {
    Write-Host "Could not verify exclusions: $_" -ForegroundColor Red
}

Write-Host "`n=== Done ===" -ForegroundColor Cyan

