# Complete RustDesk Fix Script - Execute everything
Write-Host "=== RustDesk Complete Fix Script ===" -ForegroundColor Cyan
Write-Host ""

# Check admin
$isAdmin = ([Security.Principal.WindowsPrincipal] [Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole([Security.Principal.WindowsBuiltInRole]::Administrator)
if (-not $isAdmin) {
    Write-Host "WARNING: Not running as Administrator. Some operations may fail." -ForegroundColor Yellow
    Write-Host "Attempting to continue anyway..." -ForegroundColor Yellow
    Write-Host ""
}

# Step 1: Add Windows Defender Exclusions
Write-Host "Step 1: Adding Windows Defender Exclusions..." -ForegroundColor Cyan
try {
    $rustdeskPath = "C:\Program Files\RustDesk"
    $rustdeskExe = "RustDesk.exe"

    $currentPaths = (Get-MpPreference -ErrorAction SilentlyContinue).ExclusionPath
    if ($currentPaths -notcontains $rustdeskPath) {
        Add-MpPreference -ExclusionPath $rustdeskPath -ErrorAction Stop
        Write-Host "  Added path exclusion" -ForegroundColor Green
    } else {
        Write-Host "  Path exclusion already exists" -ForegroundColor Yellow
    }

    $currentProcesses = (Get-MpPreference -ErrorAction SilentlyContinue).ExclusionProcess
    if ($currentProcesses -notcontains $rustdeskExe) {
        Add-MpPreference -ExclusionProcess $rustdeskExe -ErrorAction Stop
        Write-Host "  Added process exclusion" -ForegroundColor Green
    } else {
        Write-Host "  Process exclusion already exists" -ForegroundColor Yellow
    }
} catch {
    Write-Host "  Could not add exclusions: $_" -ForegroundColor Red
    Write-Host "  Continuing with reinstall..." -ForegroundColor Yellow
}

Write-Host ""

# Step 2: Stop service
Write-Host "Step 2: Stopping RustDesk service..." -ForegroundColor Cyan
try {
    Stop-Service RustDesk -Force -ErrorAction Stop
    Start-Sleep -Seconds 2
    Write-Host "  Service stopped" -ForegroundColor Green
} catch {
    Write-Host "  Could not stop service: $_" -ForegroundColor Yellow
}

Write-Host ""

# Step 3: Uninstall via winget
Write-Host "Step 3: Uninstalling via winget..." -ForegroundColor Cyan
if (Get-Command winget -ErrorAction SilentlyContinue) {
    $uninstallOutput = winget uninstall RustDesk.RustDesk --accept-source-agreements --accept-package-agreements 2>&1
    if ($LASTEXITCODE -eq 0) {
        Write-Host "  Uninstalled successfully" -ForegroundColor Green
    } else {
        Write-Host "  Uninstall failed or RustDesk not found via winget" -ForegroundColor Yellow
        Write-Host "  Will attempt fresh install anyway" -ForegroundColor Yellow
    }
} else {
    Write-Host "  winget not available, skipping uninstall" -ForegroundColor Yellow
}

Start-Sleep -Seconds 3

Write-Host ""

# Step 4: Install latest via winget
Write-Host "Step 4: Installing latest RustDesk via winget..." -ForegroundColor Cyan
