# RustDesk Service Fix Script

Write-Host "=== Disabling Service Auto-Restart ===" -ForegroundColor Cyan
try {
    # Configure service failure recovery to take no action
    $result = sc.exe failure RustDesk reset= 0 actions= ""/60000/""/60000/""
    if ($LASTEXITCODE -eq 0) {
        Write-Host "Service auto-restart disabled successfully" -ForegroundColor Green
    } else {
        Write-Host "Failed to disable auto-restart. Error: $result" -ForegroundColor Red
        Write-Host "Exit code: $LASTEXITCODE" -ForegroundColor Red
        Write-Host "This may require administrator privileges" -ForegroundColor Yellow
    }
} catch {
    Write-Host "Error disabling auto-restart: $_" -ForegroundColor Red
    Write-Host "This may require administrator privileges" -ForegroundColor Yellow
}

Write-Host "`n=== Stopping RustDesk Service ===" -ForegroundColor Cyan
try {
    Stop-Service RustDesk -Force -ErrorAction Stop
    Write-Host "Service stopped successfully" -ForegroundColor Green
    Start-Sleep -Seconds 3
} catch {
    Write-Host "Failed to stop service: $_" -ForegroundColor Red
    Write-Host "Service may already be stopped or may require administrator privileges" -ForegroundColor Yellow
}

Write-Host "`n=== Current Service Status ===" -ForegroundColor Cyan
$service = Get-Service RustDesk -ErrorAction SilentlyContinue
if ($service) {
    Write-Host "Service Status: $($service.Status)" -ForegroundColor $(if ($service.Status -eq 'Stopped') { 'Green' } else { 'Yellow' })
} else {
    Write-Host "Service not found" -ForegroundColor Red
}

Write-Host "`n=== Testing Manual Service Startup ===" -ForegroundColor Cyan
Write-Host "Attempting to start service..." -ForegroundColor Yellow
try {
    Start-Service RustDesk -ErrorAction Stop
    Write-Host "Service start command issued" -ForegroundColor Green
    Start-Sleep -Seconds 5

    $service = Get-Service RustDesk -ErrorAction SilentlyContinue
    if ($service) {
        Write-Host "Service Status after start: $($service.Status)" -ForegroundColor $(if ($service.Status -eq 'Running') { 'Green' } else { 'Yellow' })
    }

    Write-Host "`nChecking Event Viewer for recent RustDesk events..." -ForegroundColor Cyan
    Start-Sleep -Seconds 2
    $recentEvents = Get-EventLog -LogName System -Source "Service Control Manager" -Newest 10 | Where-Object { $_.Message -like "*RustDesk*" } | Select-Object -First 5
    if ($recentEvents) {
        Write-Host "Recent RustDesk service events:" -ForegroundColor Yellow
        $recentEvents | ForEach-Object {
            Write-Host "  Time: $($_.TimeGenerated), EventID: $($_.EventID), Type: $($_.EntryType)"
            $shortMsg = $_.Message.Substring(0, [Math]::Min(150, $_.Message.Length))
            Write-Host "  Message: $shortMsg..."
            Write-Host ""
        }
    } else {
        Write-Host "No recent RustDesk events found" -ForegroundColor Green
    }

    Write-Host "`nTesting port 21115..." -ForegroundColor Cyan
    $portTest = Test-NetConnection -ComputerName localhost -Port 21115 -WarningAction SilentlyContinue
    if ($portTest.TcpTestSucceeded) {
        Write-Host "Port 21115 is listening! Service appears to be working." -ForegroundColor Green
    } else {
        Write-Host "Port 21115 is not listening. Service may still be crashing." -ForegroundColor Red
    }
} catch {
    Write-Host "Failed to start service: $_" -ForegroundColor Red
    Write-Host "This may require administrator privileges" -ForegroundColor Yellow
}

